import React from 'react';
import '../css/Video_Call.css'

export default function Video_Call() {
  return (
    <div>
        <div className='videocall'>
                <p>The list contain the call requests which made by you, it will contain the requests which you received from other users.</p>
        </div>
    </div>
  )
}
